import React from 'react';

const Home = () => {
  return (
    <div>
      <h1>Home</h1>
      <p>
      Lorem ipsum dolor sit amet, consectetur adipiscing elit.Sed molestie vitae ligula sed vehicula.Nulla facilisi.Donec venenatis turpis libero, a semper urna rhoncus ut.Curabitur et sapien luctus, consequat libero a, laoreet tortor.Interdum et malesuada fames ac ante ipsum primis in faucibus.In vehicula vestibulum est eu tristique.Ut dapibus, metus a auctor viverra, quam nulla pharetra nulla, ac convallis elit nunc ac metus.Nam rutrum quam et faucibus consectetur.Phasellus fringilla faucibus ex a dignissim.

      Praesent auctor nisi magna, sed imperdiet risus fermentum eget.Cras ex lorem, sodales et rutrum a, porttitor ut odio.Sed vel odio tempus, rutrum metus eu, vulputate purus.Orci varius natoque penatibus et magnis dis parturient montes, nascetur ridiculus mus.Nam urna quam, posuere facilisis molestie id, accumsan vitae nisi.Curabitur molestie felis vitae vehicula lobortis.Morbi non arcu neque.Donec ut velit et ante posuere rutrum ut quis nisl.Nulla id bibendum risus.Cras faucibus at tellus nec dapibus.Curabitur at turpis arcu.Sed id nisl et libero luctus vulputate.Quisque sed leo at mi imperdiet vulputate vel vitae velit.Pellentesque habitant morbi tristique senectus et netus et malesuada fames ac turpis egestas.Suspendisse maximus sapien vitae ipsum viverra pharetra.

      Ut finibus varius dolor, tempor semper metus suscipit sit amet.Sed vel tincidunt diam, at convallis justo.Mauris nisl dui, pulvinar at metus id, interdum fringilla risus.Praesent quis ante porttitor, lacinia magna eu, dapibus sem.Donec in neque molestie arcu fermentum lobortis.Nunc tincidunt dui ac aliquam tempor.Nam pellentesque, metus vitae euismod elementum, orci urna aliquet nisl, at tincidunt tellus arcu eget magna.In nisi est, malesuada at mattis eget, pellentesque at arcu.In in ex scelerisque, cursus turpis sagittis, hendrerit turpis.Sed vel ex nibh.In id viverra orci, eget accumsan turpis.Etiam tempor scelerisque lacus, ut ultricies nisl fermentum et.Ut nec mollis ex.Morbi fermentum nisi massa, sit amet feugiat augue convallis quis.Donec finibus nulla odio, sed molestie diam congue eget.

      Mauris blandit mattis sapien, ac imperdiet arcu semper id.Pellentesque habitant morbi tristique senectus et netus et malesuada fames ac turpis egestas.Sed consectetur neque ligula, nec accumsan quam mollis et.Lorem ipsum dolor sit amet, consectetur adipiscing elit.Nullam quis quam mollis, posuere nisl ac, efficitur ante.Cras porttitor iaculis pretium.Donec dictum eget erat vitae sagittis.Nunc consectetur eros eu nibh elementum, eu gravida sapien pulvinar.Vestibulum sagittis viverra viverra.Nullam vulputate porttitor ultrices.Proin tincidunt magna vitae sem porta, vel fringilla metus malesuada.

      Cras egestas faucibus arcu.Proin nec dictum sapien, non blandit est.Donec lacinia suscipit ligula a sollicitudin.Aliquam vel mattis est.Sed a nunc sed turpis auctor tincidunt.Ut vehicula commodo lacus, quis viverra nibh facilisis et.Curabitur quis ex nisl.Morbi sed elementum ligula.Nulla facilisi.Duis tincidunt, arcu eget vestibulum varius, libero lectus maximus elit, vel finibus tellus augue et quam.Ut finibus interdum felis eget vestibulum.Cras accumsan leo faucibus orci pellentesque, sit amet varius eros pharetra.Integer rutrum auctor turpis, in tempor urna finibus a.Nulla vel lectus quis elit tempor egestas in quis justo.Etiam congue ultrices ante vitae tempor.Ut eget mattis nibh.

      </p>
    </div>
  );
};

export default Home;
